n and (max-width: 900px) {\n    body.docs {\n        padding-top: 0;\n    }\n}\n\na {\n    text-decoration: none;\n    color: #34495e;\n}\n\nimg {\n    border: none;\n}\n\nh1,\nh2,\nh3,\nh4,\nstrong {\n    font-weight: 600;\n    color: #2c3e50;\n}\n\ncode,\npre {\n    font-family: 'Roboto Mono', Monaco, courier, monospace;\n    font-size: 0.8em;\n    background-color: #f8f8f8;\n    -webkit-font-smoothing: initial;\n    -moz-osx-font-smoothing: initial;\n}\n\ncode {\n    color: #e96900;\n    padding: 3px 5px;\n    margin: 0 2px;\n    border-radius: 2px;\n    white-space: nowrap;\n}\n\nem {\n    color: #7f8c8d;\n}\n\np {\n    word-spacing: 0.05em;\n}\n\na.button {\n    padding: 0.75em 2em;\n    border-radius: 2em;\n    display: inline-block;\n    color: #fff;\n    background-color: #4fc08d;\n    transition: all 0.15s ease;\n    box-sizing: border-box;\n    border: 1px solid #4fc08d;\n}\n\na.button.white {\n    background-color: #fff;\n    color: #42b983;\n}\n\n.highlight {\n    overflow-x: auto;\n    position: relative;\n    padding: 0;\n    background-color: #f8f8f8;\n    padding: 0.8em 0.8em 0.4em;\n    line-height: 1.1em;\n    border-radius: 2px;\n}\n\n.highlight table,\n.highlight tr,\n.highlight td {\n    width: 100%;\n    border-collapse: collapse;\n    padding: 0;\n    margin: 0;\n}\n\n.highlight .gutter {\n    width: 1.5em;\n}\n\n.highlight .code pre {\n    padding: 1.2em 1.4em;\n    line-height: 1.5em;\n    margin: 0;\n}\n\n.highlight .code .line {\n    min-height: 1.5em;\n}\n\n.highlight.html .code:after,\n.highlight.js .code:after,\n.highlight.bash .code:after,\n.highlight.css .code:after {\n    position: absolute;\n    top: 0;\n    right: 0;\n    color: #ccc;\n    text-align: right;\n    font-size: 0.75em;\n    padding: 5px 10px 0;\n    line-height: 15px;\n    height: 15px;\n    font-weight: 600;\n}\n\n.highlight.html .code:after {\n    content: 'HTML';\n}\n\n.highlight.js .code:after {\n    content: 'JS';\n}\n\n.highlight.bash .code:after {\n    content: 'Shell';\n}\n\n.highlight.css .code:after {\n    content: 'CSS';\n}\n\n#main {\n    position: relative;\n    z-index: 1;\n    padding: 0 60px 30px;\n    overflow-x: hidden;\n}\n\n#ad {\n    width: 125px;\n    position: fixed;\n    z-index: 99;\n    bottom: 10px;\n    right: 10px;\n    padding: 10px;\n    background-color: #fff;\n    border-radius: 3px;\n    font-size: 13px;\n}\n\n#ad a {\n    display: inline-block;\n    color: #7f8c8d;\n    font-weight: normal;\n}\n\n#ad span {\n    color: #7f8c8d;\n    display: inline-block;\n    margin-bottom: 5px;\n}\n\n#ad img {\n    width: 125px;\n}\n\n#ad .carbon-img,\n#ad .carbon-text {\n    display: block;\n    margin-bottom: 6px;\n    font-weight: normal;\n    color: #34495e;\n}\n\n#ad .carbon-poweredby {\n    color: #aaa;\n    font-weight: normal;\n}\n\n#nav .nav-link {\n    cursor: pointer;\n}\n\n#nav .nav-dropdown-container .nav-link:hover {\n    border-bottom: none;\n}\n\n#nav .nav-dropdown-container:hover .nav-dropdown {\n    display: block;\n}\n\n#nav .nav-dropdown-container.language {\n    margin-left: 20px;\n}\n\n#nav .nav-dropdown-container .arrow {\n    pointer-events: none;\n}\n\n#nav .nav-dropdown {\n    display: none;\n    box-sizing: border-box;\n    max-height: calc(100vh - 61px);\n    overflow-y: auto;\n    position: absolute;\n    top: 100%;\n    right: -15px;\n    background-color: #fff;\n    padding: 10px 0;\n    border: 1px solid #ddd;\n    border-bottom-color: #ccc;\n    text-align: left;\n    border-radius: 4px;\n    white-space: nowrap;\n}\n\n#nav .nav-dropdown li {\n    line-height: 1.8em;\n    margin: 0;\n    display: block;\n}\n\n#nav .nav-dropdown li>ul {\n    padding-left: 0;\n}\n\n#nav .nav-dropdown li:first-child h4 {\n    margin-top: 0;\n    padding-top: 0;\n    border-top: 0;\n}\n\n#nav .nav-dropdown a,\n#nav .nav-dropdown h4 {\n    padding: 0 24px 0 20px;\n}\n\n#nav .nav-dropdown h4 {\n    margin: 0.45em 0 0;\n    padding-top: 0.45em;\n    border-top: 1px solid #eee;\n}\n\n#nav .nav-dropdown